import { Injectable } from '@angular/core';

import { Project } from './project/project';
import { PROJECTS } from './project/projects';

@Injectable({
  providedIn: 'root'
})
export class ProjectService {

  constructor() { }

  getProjects(): Project[] {
    return PROJECTS;
  }
}
